e\";s:15:\"Menu link count\";s:11:\"description\";s:47:\"The number of menu links belonging to the menu.\";}s:4:\"name\";a:2:{s:4:\"name\";s:4:\"Name\";s:11:\"description\";s:21:\"The name of the menu.\";}}s:7:\"metatag\";a:29:{s:6:\"author\";a:2:{s:4:\"name\";s:25:\"Advanced tags: Author URL\";s:11:\"description\";s:194:\"Used by some search engines to confirm authorship of the content on a page. Should be either the full URL for the author\'s Google+ profile page or a local page with information about the author.\";}s:13:\"cache-control\";a:2:{s:4:\"name\";s:28:\"Advanced tags: Cache-Control\";s:11:\"description\";s:140:\"Used to control whether a browser caches a specific page locally. Little used today. Should be used in conjunction with the Pragma meta tag.\";}s:9:\"canonical\";a:2:{s:4:\"name\";s:28:\"Advanced tags: Canonical URL\";s:11:\"description\";s:86:\"Preferred page location or URL to help eliminate duplicate content for search engines.\";}s:16:\"content-language\";a:2:{s:4:\"name\";s:31:\"Advanced tags: Content language\";s:11:\"description\";s:75:\"A deprecated meta tag for defining this page\'s two-letter language code(s).\";}s:6:\"rating\";a:2:{s:4:\"name\";s:29:\"Advanced tags: Content rating\";s:11:\"description\";s:55:\"Used to indicate the intended audience for the content.\";}s:7:\"expires\";a:2:{s:4:\"name\";s:22:\"Advanced tags: Expires\";s:11:\"description\";s:330:\"Control when the browser\'s internal cache of the current page should expire. The date must to be an <a href=\"http://www.csgnetwork.com/timerfc1123calc.html\">RFC-1123</a>-compliant date string that is represented in Greenwich Mean Time (GMT), e.g. \'Thu, 07 Jul 2016 15:42:52 GMT\'. Set to \'0\' to stop the page being cached entirely.\";}s:9:\"generator\";a:2:{s:4:\"name\";s:24:\"Advanced tags: Generator\";s:11:\"description\";s:97:\"Describes the name and version number of the software or publishing tool used to create the page.\";}s:13:\"geo.placename\";a:2:{s:4:\"name\";s:29:\"Advanced tags: Geo place name\";s:11:\"description\";s:25:\"A location\'s formal name.\";}s:12:\"geo.position\";a:2:{s:4:\"name\";s:27:\"Advanced tags: Geo position\";s:11:\"description\";s:176:\"Geo-spatial information in \"latitude;longitude\" format, e.g. \"50.167958;-97.133185\"; <a href=\"http://en.wikipedia.org/wiki/Geotagging#HTML_pages\">see Wikipedia for details</a>.\";}s:10:\"geo.region\";a:2:{s:4:\"name\";s:25:\"Advanced tags: Geo region\";s:11:\"description\";s:130:\"A location\'s two-letter international country code, with an optional two-letter region, e.g. \"US-NH\" for New Hampshire in the USA.\";}s:13:\"news_keywords\";a:2:{s:4:\"name\";s:35:\"Advanced tags: Google News Keywords\";s:11:\"description\";s:196:\"A comma-separated list of keywords about the page. This meta tag is used as an indicator in <a href=\"http://support.google.com/news/publisher/bin/answer.py?hl=en&amp;answer=68297\">Google News</a>.\";}s:8:\"standout\";a:2:{s:4:\"name\";s:30:\"Advanced tags: Google Standout\";s:11:\"description\";s:282:\"Highlight standout journalism on the web, especially for breaking news; used as an indicator in <a href=\"https://support.google.com/news/publisher/answer/191283?hl=en&amp;ref_topic=2484650\">Google News</a>. Warning: Don\'t abuse it, to be used a maximum of 7 times per calendar week!\";}s:4:\"icbm\";a:2:{s:4:\"name\";s:19:\"Advanced tags: ICBM\";s:11:\"description\";s:161:\"Geo-spatial information in \"latitude, longitude\" format, e.g. \"50.167958, -97.133185\"; <a href=\"http://en.wikipedia.org/wiki/ICBM\">see Wikipedia for details</a>.\";}s:9:\"image_src\";a:2:{s:4:\"name\";s:20:\"Advanced tags: Image\";s:11:\"description\";s:97:\"An image associated with this page, for use as a thumbnail in social networks and other services.\";}s:4:\"next\";a:2:{s:4:\"name\";s:28:\"Advanced tags: Next page URL\";s:11:\"description\";s:191:\"Used for paginated content. Meet Google recommendations to <a href=\"https://support.google.com/webmasters/answer/1663744\">indicate paginated content</a> by providing URL with rel=\"next\" link.\";}s:15:\"original-source\";a:2:{s:4:\"name\";s:30:\"Advanced tags: Original Source\";s:11:\"description\";s:200:\"Used to indicate the URL that broke the story, and can link to either an internal URL or an external source. If the full URL is not known it is acceptable to use a partial URL or just the domain name.\";}s:6:\"pragma\";a:2:{s:4:\"name\";s:21:\"Advanced tags: Pragma\";s:11:\"description\";s:147:\"Used to control whether a browser caches a specific page locally. Little used today. Should be used in conjunction with the Cache-Control meta tag.\";}s:4:\"prev\";a:2:{s:4:\"name\";s:32:\"Advanced tags: Previous page URL\";s:11:\"description\";s:191:\"Used for paginated content. Meet Google recommendations to <a href=\"https://support.google.com/webmasters/answer/1663744\">indicate paginated content</a> by providing URL with rel=\"prev\" link.\";}s:9:\"publisher\";a:2:{s:4:\"name\";s:28:\"Advanced tags: Publisher URL\";s:11:\"description\";s:0:\"\";}s:8:\"referrer\";a:2:{s:4:\"name\";s:30:\"Advanced tags: Referrer policy\";s:11:\"description\";s:207:\"Indicate to search engines and other page scrapers whether or not links should be followed. See <a href=\"http://w3c.github.io/webappsec/specs/referrer-policy/\">the W3C specifications</a> for further details.\";}s:7:\"refresh\";a:2:{s:4:\"name\";s:22:\"Advanced tags: Refresh\";s:11:\"description\";s:189:\"The number of seconds to wait before refreshing the page. May also force redirect to another page using the format \"5; url=http://example.com/\", which would be triggered after five seconds.\";}s:13:\"revisit-after\";a:2:{s:4:\"name\";s:28:\"Advanced tags: Revisit After\";s:11:\"description\";s:193:\"Tell search engines when to index the page again. Very few search engines support this tag, it is more useful to use an <a href=\"https://www.drupal.org/project/xmlsitemap\">XML Sitemap</a> file.\";}s:6:\"rights\";a:2:{s:4:\"name\";s:21:\"Advanced tags: Rights\";s:11:\"description\";s:145:\"Details about intellectual property, such as copyright or trademarks; does not automatically protect the site\'s content or intellectual property.\";}s:6:\"robots\";a:2:{s:4:\"name\";s:21:\"Advanced tags: Robots\";s:11:\"description\";s:90:\"Provides search engines with specific directions for what to do when this page is indexed.\";}s:9:\"shortlink\";a:2:{s:4:\"name\";s:28:\"Advanced tags: Shortlink URL\";s:11:\"description\";s:55:\"A brief URL, often created by a URL shortening service.\";}s:8:\"abstract\";a:2:{s:4:\"name\";s:20:\"Basic tags: Abstract\";s:11:\"description\";s:161:\"A brief and concise summary of the page\'s content, preferably 150 characters or less. The abstract meta tag may be used by search engines for archiving purposes.\";}s:11:\"description\";a:2:{s:4:\"name\";s:23:\"Basic tags: Description\";s:11:\"description\";s:195:\"A brief and concise summary of the page\'s content, preferably 150 characters or less. The description meta tag may be used by search engines to display a snippet about the page in search results.\";}s:8:\"keywords\";a:2:{s:4:\"name\";s:20:\"Basic tags: Keywords\";s:11:\"description\";s:122:\"A comma-separated list of keywords about the page. This meta tag is <em>not</em> supported by most search engines anymore.\";}s:5:\"title\";a:2:{s:4:\"name\";s:22:\"Basic tags: Page title\";s:11:\"description\";s:194:\"The text to display in the title bar of a visitor\'s web browser when they view this page. This meta tag may also be used as the title of the page when a visitor bookmarks or favorites this page.\";}}s:4:\"site\";a:6:{s:4:\"mail\";a:2:{s:4:\"name\";s:5:\"Email\";s:11:\"description\";s:46:\"The administrative email address for the site.\";}s:9:\"login-url\";a:2:{s:4:\"name\";s:10:\"Login page\";s:11:\"description\";s:33:\"The URL of the site\'s login page.\";}s:4:\"name\";a:2:{s:4:\"name\";s:4:\"Name\";s:11:\"description\";s:21:\"The name of the site.\";}s:6:\"slog